import AMapLoader from '@amap/amap-jsapi-loader';

export default {
  name: 'extend-map',
  data() {
    return {
      key: ''
    }
  },
  mounted() {
    this.init()
  },
  methods: {
    init() {
      AMapLoader.load({
        key: this.define.aMapJsKey,
        version: '2.0',
      }).then(AMap => {
        const query = {
          viewMode: '3D',
          zoom: 11,
          center: [116.397428, 39.90923],
        };
        new AMap.Map('allmap', query);
      });
    }
  }
}
